import React from "react";
import ReactDOM from "react-dom/client"
import "./styles/index.css"
import Header from "./components/header";
import Slideshow from "./components/slideshow";
import QuienesSomos from "./components/quienesSomos";
import Footer from "./components/Footer";
import "./styles/scrollbar.css";
import ClubesBoard from "./components/ClubesBoard";

import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Home from "./pages/Home";
import EventsMain from "./pages/events/eventsMain";


const root = ReactDOM.createRoot(document.getElementById("root"));
/*Huevada de pagina tengo mas cosas que hacer, comer tortilla de huevo
* jugar ping pong
* beibi que mas
* hace rato que no se nah deti
* taba con alguien pero ya toy fri
* pueta pa revivir viejo tiempo no salgo hace tiempo tu dime donde taaaaaaaaa
*
* CUANDO SUENE EL BOOM DE ESTE PERREO INTENSO
* CHEKY CHEKY CHEKY CHKEY
* COMO HE DAME UNA VUELTITA OTRA VEEEEEEE
* SHAKY SHAKY SHAKY
* */
root.render(

    <BrowserRouter>
        <Header/>
       <div style={{marginTop: 200}}>
           <Routes>
               <Route path="/Inicio" element={<Home/>}/>
               <Route path="/QuienesSomos" element={<QuienesSomos/>}/>
               <Route path="/Eventos" element={<EventsMain/>}/>
           </Routes>
       </div>

        <Footer/>

    </BrowserRouter>
)
